// Import All sofbox component here...
import Loader from './Loader';
import Link from './Link';


// Helper components for the Header or Navigation...
import HeaderStyle from "./HeaderStyle";
import ProgressBar from "./ProgressBar";
import ProgressBarStyle2 from "./ProgressStyle2";
import Pagination from "./Pagination";
import SearchForm from "./SearchForm";

// CheckBoxList
import CheckboxList from './CheckBoxList';

//Sections component
import SectionLeftImage from './sections/SectionLeftImage';
import SectionRightImage from './sections/SectionRightImage';
import SectionStyle1 from './sections/SectionStyle1';
import SectionStyle3 from './sections/SectionStyle3';

import SectionTitle from './sections/SectionTitle';
import AboutStyle from './about/AboutStyle';
import AboutStyle2 from './about/AboutStyle2';
import ProgressStyle2 from './ProgressStyle2';


//Banner Style
import BannerStyle1 from '../xamin/Banner/BannerStyle1';


//Card Section
import CardStyle1 from './cards/CardStyle1';
import CardStyle2 from './cards/CardStyle2';

import CardStyle4 from './cards/CardStyle4';
import CardStyle5 from './cards/CardStyle5';
import CardStyle6 from './cards/CardStyle6';
import CardStyle7 from './cards/CardStyle7';
import CardStyle8 from './cards/CardStyle8';
import CardStyle9 from './cards/CardStyle9';
import CardStyle10 from './cards/CardStyle10';
import CardStyle11 from './cards/CardStyle11';
import CardStyle13 from './cards/CardStyle13';

import CardStyle12 from './cards/CardStyle12';

// Testimonial Card Styles
import TestimonialStyle1 from './TestimonialCards/CardStyle1';

// Portfolio
import PortfolioItem from './Portfolio';
import MasonryItem from './MasonryItem';
import ReplyForm from './ReplyForm';
import ScrollTop from './ScrollTop';
import ContactUs from './ContactUs';


// Revolution Slider
import RevSlider from './RevolutionSlider';

//Address
import FooterMain from '../xamin/partials/footers/FooterMain';
import FooterLogo from '../xamin/footerComponents/FooterLogo';
import FooterAddress from '../xamin/footerComponents/FooterAddress';
import FooterLinks from '../xamin/footerComponents/FooterLinks';
import SocialIcon from './SocialIcon';
import WaveBox from './WaveBox';
import Carousel from './Carousel';
import Accordion from './Accordion';
export {
    Loader,
    Link,
    HeaderStyle,
    ProgressBar,
    ProgressBarStyle2,
    Pagination,
    SearchForm,
    ReplyForm,
    ContactUs,
    SocialIcon,
    WaveBox,
    Carousel,
    Accordion,

    //CheckboxList
    CheckboxList,

    //Sections
    SectionLeftImage,
    SectionRightImage,
    SectionStyle1,
    SectionStyle3,
    SectionTitle,

    //Card 
    CardStyle1,
    CardStyle2,


    CardStyle4,
    CardStyle5,
    CardStyle6,
    CardStyle7,
    CardStyle8,
    CardStyle9,
    CardStyle10,
    CardStyle11,
    CardStyle13,
    CardStyle12,

    // Testimonial Style
    TestimonialStyle1,

    //Banner
    BannerStyle1,

    // PortfolioItem
    PortfolioItem,
    MasonryItem,

    //Address
    FooterMain,
    FooterLogo,
    FooterAddress,
    FooterLinks,
    ScrollTop,

    // Revolution Slider
    RevSlider,
    AboutStyle,
    AboutStyle2,
    ProgressStyle2,
}
